import React from 'react';
import Schedule from './Schedule';

const LectureRoom = (props) => {
    console.log('inside LR', props.lectureRoom);

    return (
        <div> 
            <ul>
                <li>{props.lectureRoom.name}</li>
            </ul>
            <ul>
                {props.lectureRoom.lecture_schedules.map(schedule=>
                    <Schedule key={schedule.id} schedule={schedule}
                        selectedDate={this.props.selectedDate}
                    />
                    )}
            </ul>
        </div>
     );
}

export default LectureRoom;
